sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.status == 200) {
        outputs.status = "Success";
        var responseHeaders = JSON.parse(inputs.response_headers);
        outputs.lease_status = responseHeaders['x-ms-lease-status'][0];
        outputs.access_level = responseHeaders['x-ms-blob-public-access'][0];
        outputs.lease_state = responseHeaders['x-ms-lease-state'][0];
        var keys = Object.keys(responseHeaders);
        var metadatas = [];
        for (var i in keys) {
            if (keys[i].toString().includes("x-ms-meta")) {
                var metadata = {};
                metadata.name = keys[i].replace("x-ms-meta-", "");
                metadata.value = responseHeaders[keys[i]][0];
                metadatas.push(metadata);
            }
        }
        outputs.metadata_pairs = metadatas;
    } else {
        outputs.status = "Error";
        var xmlDoc = new XMLDocument2();
        var index = inputs.response_body.indexOf(">");
        var xml = inputs.response_body.slice(index + 1, inputs.response_body
            .length);
        xmlDoc.parseXML(xml);
        var message = xmlDoc.getNodeText("/Error/Message");
        var index = message.indexOf("RequestId");
        var error = message.slice(0, index);
        outputs.error_message = error;
    }
})(inputs, outputs);

